{'full_text': '엉덩이 들고 혼자 딜도로 쑤셔보라고 시킬 거야. 그럼 너는 쑥스럽다고 살살하다 금방 흥분해서 야릇한 신음소리 내며 주인님이 박아달라고 글썽이며 격하게 하겠지. 

"발정 난 개처럼 허리 흔들고 막 싸질렀네. 박아줘? 그럼 더 애원해봐."

